import React, { useState } from "react";
import { BrowserRouter as Router, Link } from "react-router-dom";

import logo from "./logo.svg";

import "./App.css";

function Head(props) {

  var [navBar, setPos] = useState(false);

  function menuNavBar() {

    var setValue = 1;

    if (navBar === false) {

      document.getElementById("menu").style.display = "initial";

      setPos(true);

    } else {

      document.getElementById("menu").style.display = "none";

      // document.getElementById("menu").style.height = "2";
      setPos(false);

    }

  }

  return (
    <div>

      <div className="header-bar">

        <header>
          {/* <div className="logo"><span className="logo1">Young</span><span className="logo2">Accelerate</span></div> */}
          <div className="logo"><img src={logo} style={{width:"5em",marginTop:"-1em"}}/></div>
          <div className="hd-col">
            <Link to="/" className="hd" onClick={() => window.scrollTo(0,0)}>
              HOME
            </Link>

            <Link to="/about/" className="hd" onClick={()=> window.scrollTo({ top: 200, behavior: 'smooth' })}>
              ABOUT
            </Link>

            <Link to="/contact/" className="hd" onClick={() =>  window.scrollTo(0, 1200)}>
              CONTACT US
            </Link>

            <Link to="/applications/" className="hd">
              APPLICATIONS
            </Link>
          </div>
          <div className="hamburg" onClick={menuNavBar}>
            MENU
          </div>
        </header>

        <div className="menu" id="menu">
          <div className="navbar" id="navbar">
            <hr />
            <Link to="/" className="hdm home" onClick={() => window.scrollTo(0,0)}>
              HOME
            </Link>
            <hr />

            <Link to="/aboutus/" className="hdm" onClick={()=> window.scrollTo(0, 630)}>
              ABOUT
            </Link>
            <hr />

            <Link to="/contact/" className="hdm" onClick={() =>  window.scrollTo(0, 1200)}>
              CONTACT US
            </Link>
            <hr />

            <Link to="/applications/" className="hdm">
              APPLICATIONS
            </Link>
            <hr />
            {/* <Link to="/signin" className="hdm">SIGNIN</Link>
            <hr /> */}
          </div>

        </div>
      </div>
    </div>
  );
}

export default Head;
